{
  "openapi": "3.0.0",
  "info": {
    "version": "2017-07-25",
    "x-release": "v4",
    "title": "AWS Amplify",
    "description": "Amplify enables developers to develop and deploy cloud-powered mobile and web apps. The Amplify Console provides a continuous delivery and hosting service for web applications. For more information, see the Amplify Console User Guide. The Amplify Framework is a comprehensive set of SDKs, libraries, tools, and documentation for client app development. For more information, see the Amplify Framework.",
    "x-logo": {
      "url": "https://raw.githubusercontent.com/chainjet/assets/master/integrations/aws/Arch_AWS-Amplify-Console_64.svg"
    },
    "termsOfService": "https://aws.amazon.com/service-terms/",
    "contact": {
      "name": "Mike Ralphson",
      "email": "mike.ralphson@gmail.com",
      "url": "https://github.com/mermade/aws2openapi",
      "x-twitter": "PermittedSoc"
    },
    "license": {
      "name": "Apache 2.0 License",
      "url": "http://www.apache.org/licenses/"
    },
    "x-providerName": "amazonaws.com",
    "x-serviceName": "amplify",
    "x-origin": [
      {
        "contentType": "application/json",
        "url": "https://raw.githubusercontent.com/aws/aws-sdk-js/master/apis/amplify-2017-07-25.normal.json",
        "converter": {
          "url": "https://github.com/mermade/aws2openapi",
          "version": "1.0.0"
        },
        "x-apisguru-driver": "external"
      }
    ],
    "x-apiClientRegistration": {
      "url": "https://portal.aws.amazon.com/gp/aws/developer/registration/index.html?nc2=h_ct"
    },
    "x-apisguru-categories": ["cloud"],
    "x-preferred": true
  },
  "externalDocs": {
    "description": "Amazon Web Services documentation",
    "url": "https://docs.aws.amazon.com/amplify/"
  },
  "servers": [
    {
      "url": "http://amplify.{region}.amazonaws.com",
      "variables": {
        "region": {
          "description": "The AWS region",
          "enum": [
            "us-east-1",
            "us-east-2",
            "us-west-1",
            "us-west-2",
            "us-gov-west-1",
            "us-gov-east-1",
            "ca-central-1",
            "eu-north-1",
            "eu-west-1",
            "eu-west-2",
            "eu-west-3",
            "eu-central-1",
            "eu-south-1",
            "af-south-1",
            "ap-northeast-1",
            "ap-northeast-2",
            "ap-northeast-3",
            "ap-southeast-1",
            "ap-southeast-2",
            "ap-east-1",
            "ap-south-1",
            "sa-east-1",
            "me-south-1"
          ],
          "default": "us-east-1"
        }
      },
      "description": "The Amplify multi-region endpoint"
    },
    {
      "url": "https://amplify.{region}.amazonaws.com",
      "variables": {
        "region": {
          "description": "The AWS region",
          "enum": [
            "us-east-1",
            "us-east-2",
            "us-west-1",
            "us-west-2",
            "us-gov-west-1",
            "us-gov-east-1",
            "ca-central-1",
            "eu-north-1",
            "eu-west-1",
            "eu-west-2",
            "eu-west-3",
            "eu-central-1",
            "eu-south-1",
            "af-south-1",
            "ap-northeast-1",
            "ap-northeast-2",
            "ap-northeast-3",
            "ap-southeast-1",
            "ap-southeast-2",
            "ap-east-1",
            "ap-south-1",
            "sa-east-1",
            "me-south-1"
          ],
          "default": "us-east-1"
        }
      },
      "description": "The Amplify multi-region endpoint"
    },
    {
      "url": "http://amplify.{region}.amazonaws.com.cn",
      "variables": {
        "region": {
          "description": "The AWS region",
          "enum": ["cn-north-1", "cn-northwest-1"],
          "default": "cn-north-1"
        }
      },
      "description": "The Amplify endpoint for China (Beijing) and China (Ningxia)"
    },
    {
      "url": "https://amplify.{region}.amazonaws.com.cn",
      "variables": {
        "region": {
          "description": "The AWS region",
          "enum": ["cn-north-1", "cn-northwest-1"],
          "default": "cn-north-1"
        }
      },
      "description": "The Amplify endpoint for China (Beijing) and China (Ningxia)"
    }
  ],
  "x-hasEquivalentPaths": true,
  "paths": {
    "/apps": {
      "post": {
        "operationId": "CreateApp",
        "description": " Creates a new Amplify app. ",
        "responses": {
          "200": {
            "description": "Success",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/CreateAppResult" }
              }
            }
          },
          "480": {
            "description": "BadRequestException",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/BadRequestException" }
              }
            }
          },
          "481": {
            "description": "UnauthorizedException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/UnauthorizedException"
                }
              }
            }
          },
          "482": {
            "description": "InternalFailureException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/InternalFailureException"
                }
              }
            }
          },
          "483": {
            "description": "LimitExceededException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/LimitExceededException"
                }
              }
            }
          },
          "484": {
            "description": "DependentServiceFailureException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/DependentServiceFailureException"
                }
              }
            }
          }
        },
        "parameters": [],
        "requestBody": {
          "required": true,
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "required": ["name"],
                "properties": {
                  "name": {
                    "description": " The name for the Amplify app. ",
                    "type": "string",
                    "minLength": 1,
                    "maxLength": 255
                  },
                  "description": {
                    "description": " The description for an Amplify app. ",
                    "type": "string",
                    "maxLength": 1000
                  },
                  "repository": {
                    "description": " The repository for an Amplify app. ",
                    "type": "string",
                    "maxLength": 1000
                  },
                  "platform": {
                    "description": " The platform or framework for an Amplify app. ",
                    "type": "string",
                    "enum": ["WEB"]
                  },
                  "iamServiceRoleArn": {
                    "description": " The AWS Identity and Access Management (IAM) service role for an Amplify app. ",
                    "type": "string",
                    "minLength": 1,
                    "maxLength": 1000
                  },
                  "oauthToken": {
                    "description": " The OAuth token for a third-party source control system for an Amplify app. The OAuth token is used to create a webhook and a read-only deploy key. The OAuth token is not stored. ",
                    "type": "string",
                    "maxLength": 100,
                    "format": "password"
                  },
                  "accessToken": {
                    "description": " The personal access token for a third-party source control system for an Amplify app. The personal access token is used to create a webhook and a read-only deploy key. The token is not stored. ",
                    "type": "string",
                    "minLength": 1,
                    "maxLength": 255,
                    "format": "password"
                  },
                  "environmentVariables": {
                    "description": " The environment variables map for an Amplify app. ",
                    "type": "object",
                    "additionalProperties": {
                      "$ref": "#/components/schemas/EnvValue"
                    }
                  },
                  "enableBranchAutoBuild": {
                    "description": " Enables the auto building of branches for an Amplify app. ",
                    "type": "boolean"
                  },
                  "enableBranchAutoDeletion": {
                    "description": " Automatically disconnects a branch in the Amplify Console when you delete a branch from your Git repository. ",
                    "type": "boolean"
                  },
                  "enableBasicAuth": {
                    "description": " Enables basic authorization for an Amplify app. This will apply to all branches that are part of this app. ",
                    "type": "boolean"
                  },
                  "basicAuthCredentials": {
                    "description": " The credentials for basic authorization for an Amplify app. ",
                    "type": "string",
                    "maxLength": 2000,
                    "format": "password"
                  },
                  "customRules": {
                    "description": " The custom rewrite and redirect rules for an Amplify app. ",
                    "type": "array",
                    "items": { "$ref": "#/components/schemas/CustomRule" }
                  },
                  "tags": {
                    "description": " The tag for an Amplify app. ",
                    "type": "object",
                    "minProperties": 1,
                    "maxProperties": 50,
                    "additionalProperties": {
                      "$ref": "#/components/schemas/TagValue"
                    }
                  },
                  "buildSpec": {
                    "description": " The build specification (build spec) file for an Amplify app build. ",
                    "type": "string",
                    "minLength": 1,
                    "maxLength": 25000
                  },
                  "enableAutoBranchCreation": {
                    "description": " Enables automated branch creation for the Amplify app. ",
                    "type": "boolean"
                  },
                  "autoBranchCreationPatterns": {
                    "description": " The automated branch creation glob patterns for the Amplify app. ",
                    "type": "array",
                    "items": {
                      "$ref": "#/components/schemas/AutoBranchCreationPattern"
                    }
                  },
                  "autoBranchCreationConfig": {
                    "description": " Describes the automated branch creation configuration. ",
                    "type": "object",
                    "properties": {
                      "stage": {
                        "allOf": [
                          { "$ref": "#/components/schemas/Stage" },
                          {
                            "description": " Describes the current stage for the autocreated branch. "
                          }
                        ]
                      },
                      "framework": {
                        "allOf": [
                          { "$ref": "#/components/schemas/Framework" },
                          {
                            "description": " The framework for the autocreated branch. "
                          }
                        ]
                      },
                      "enableAutoBuild": {
                        "allOf": [
                          { "$ref": "#/components/schemas/EnableAutoBuild" },
                          {
                            "description": " Enables auto building for the autocreated branch. "
                          }
                        ]
                      },
                      "environmentVariables": {
                        "allOf": [
                          {
                            "$ref": "#/components/schemas/EnvironmentVariables"
                          },
                          {
                            "description": " The environment variables for the autocreated branch. "
                          }
                        ]
                      },
                      "basicAuthCredentials": {
                        "allOf": [
                          {
                            "$ref": "#/components/schemas/BasicAuthCredentials"
                          },
                          {
                            "description": " The basic authorization credentials for the autocreated branch. "
                          }
                        ]
                      },
                      "enableBasicAuth": {
                        "allOf": [
                          { "$ref": "#/components/schemas/EnableBasicAuth" },
                          {
                            "description": " Enables basic authorization for the autocreated branch. "
                          }
                        ]
                      },
                      "buildSpec": {
                        "allOf": [
                          { "$ref": "#/components/schemas/BuildSpec" },
                          {
                            "description": " The build specification (build spec) for the autocreated branch. "
                          }
                        ]
                      },
                      "enablePullRequestPreview": {
                        "allOf": [
                          {
                            "$ref": "#/components/schemas/EnablePullRequestPreview"
                          },
                          {
                            "description": " Enables pull request preview for the autocreated branch. "
                          }
                        ]
                      },
                      "pullRequestEnvironmentName": {
                        "allOf": [
                          {
                            "$ref": "#/components/schemas/PullRequestEnvironmentName"
                          },
                          {
                            "description": " The Amplify environment name for the pull request. "
                          }
                        ]
                      },
                      "enablePerformanceMode": {
                        "allOf": [
                          {
                            "$ref": "#/components/schemas/EnablePerformanceMode"
                          },
                          {
                            "description": " Performance mode optimizes for faster hosting performance by keeping content cached at the edge for a longer interval. Enabling performance mode will mean that hosting configuration or code changes can take up to 10 minutes to roll out. "
                          }
                        ]
                      }
                    }
                  },
                  "customHeaders": {
                    "description": "The custom HTTP headers for an Amplify app.",
                    "type": "string",
                    "minLength": 1,
                    "maxLength": 25000
                  }
                }
              }
            }
          }
        },
        "summary": "Create App"
      },
      "parameters": [
        { "$ref": "#/components/parameters/X-Amz-Content-Sha256" },
        { "$ref": "#/components/parameters/X-Amz-Date" },
        { "$ref": "#/components/parameters/X-Amz-Algorithm" },
        { "$ref": "#/components/parameters/X-Amz-Credential" },
        { "$ref": "#/components/parameters/X-Amz-Security-Token" },
        { "$ref": "#/components/parameters/X-Amz-Signature" },
        { "$ref": "#/components/parameters/X-Amz-SignedHeaders" }
      ],
      "get": {
        "operationId": "ListApps",
        "description": " Returns a list of the existing Amplify apps. ",
        "responses": {
          "200": {
            "description": "Success",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/ListAppsResult" }
              }
            }
          },
          "480": {
            "description": "BadRequestException",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/BadRequestException" }
              }
            }
          },
          "481": {
            "description": "UnauthorizedException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/UnauthorizedException"
                }
              }
            }
          },
          "482": {
            "description": "InternalFailureException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/InternalFailureException"
                }
              }
            }
          }
        },
        "parameters": [
          {
            "name": "nextToken",
            "in": "query",
            "required": false,
            "description": " A pagination token. If non-null, the pagination token is returned in a result. Pass its value in another request to retrieve more entries. ",
            "schema": { "type": "string", "maxLength": 2000 }
          },
          {
            "name": "maxResults",
            "in": "query",
            "required": false,
            "description": " The maximum number of records to list in a single response. ",
            "schema": { "type": "integer", "minimum": 1, "maximum": 100 }
          }
        ],
        "summary": "List Apps"
      }
    },
    "/apps/{appId}/backendenvironments": {
      "post": {
        "operationId": "CreateBackendEnvironment",
        "description": " Creates a new backend environment for an Amplify app. ",
        "responses": {
          "200": {
            "description": "Success",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/CreateBackendEnvironmentResult"
                }
              }
            }
          },
          "480": {
            "description": "BadRequestException",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/BadRequestException" }
              }
            }
          },
          "481": {
            "description": "UnauthorizedException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/UnauthorizedException"
                }
              }
            }
          },
          "482": {
            "description": "NotFoundException",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/NotFoundException" }
              }
            }
          },
          "483": {
            "description": "InternalFailureException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/InternalFailureException"
                }
              }
            }
          },
          "484": {
            "description": "LimitExceededException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/LimitExceededException"
                }
              }
            }
          }
        },
        "parameters": [
          {
            "name": "appId",
            "in": "path",
            "required": true,
            "description": " The unique ID for an Amplify app. ",
            "schema": {
              "type": "string",
              "minLength": 1,
              "maxLength": 255,
              "pattern": "d[a-z0-9]+"
            }
          }
        ],
        "requestBody": {
          "required": true,
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "required": ["environmentName"],
                "properties": {
                  "environmentName": {
                    "description": " The name for the backend environment. ",
                    "type": "string",
                    "minLength": 1,
                    "maxLength": 255
                  },
                  "stackName": {
                    "description": " The AWS CloudFormation stack name of a backend environment. ",
                    "type": "string",
                    "minLength": 1,
                    "maxLength": 255
                  },
                  "deploymentArtifacts": {
                    "description": " The name of deployment artifacts. ",
                    "type": "string",
                    "minLength": 1,
                    "maxLength": 1000
                  }
                }
              }
            }
          }
        },
        "summary": "Create Backend Environment"
      },
      "parameters": [
        { "$ref": "#/components/parameters/X-Amz-Content-Sha256" },
        { "$ref": "#/components/parameters/X-Amz-Date" },
        { "$ref": "#/components/parameters/X-Amz-Algorithm" },
        { "$ref": "#/components/parameters/X-Amz-Credential" },
        { "$ref": "#/components/parameters/X-Amz-Security-Token" },
        { "$ref": "#/components/parameters/X-Amz-Signature" },
        { "$ref": "#/components/parameters/X-Amz-SignedHeaders" }
      ],
      "get": {
        "operationId": "ListBackendEnvironments",
        "description": " Lists the backend environments for an Amplify app. ",
        "responses": {
          "200": {
            "description": "Success",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ListBackendEnvironmentsResult"
                }
              }
            }
          },
          "480": {
            "description": "BadRequestException",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/BadRequestException" }
              }
            }
          },
          "481": {
            "description": "UnauthorizedException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/UnauthorizedException"
                }
              }
            }
          },
          "482": {
            "description": "InternalFailureException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/InternalFailureException"
                }
              }
            }
          }
        },
        "parameters": [
          {
            "name": "appId",
            "in": "path",
            "required": true,
            "description": " The unique ID for an Amplify app. ",
            "schema": {
              "type": "string",
              "minLength": 1,
              "maxLength": 255,
              "pattern": "d[a-z0-9]+"
            }
          },
          {
            "name": "environmentName",
            "in": "query",
            "required": false,
            "description": " The name of the backend environment ",
            "schema": { "type": "string", "minLength": 1, "maxLength": 255 }
          },
          {
            "name": "nextToken",
            "in": "query",
            "required": false,
            "description": " A pagination token. Set to null to start listing backend environments from the start. If a non-null pagination token is returned in a result, pass its value in here to list more backend environments. ",
            "schema": { "type": "string", "maxLength": 2000 }
          },
          {
            "name": "maxResults",
            "in": "query",
            "required": false,
            "description": " The maximum number of records to list in a single response. ",
            "schema": { "type": "integer", "minimum": 1, "maximum": 100 }
          }
        ],
        "summary": "List Backend Environments"
      }
    },
    "/apps/{appId}/branches": {
      "post": {
        "operationId": "CreateBranch",
        "description": " Creates a new branch for an Amplify app. ",
        "responses": {
          "200": {
            "description": "Success",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/CreateBranchResult" }
              }
            }
          },
          "480": {
            "description": "BadRequestException",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/BadRequestException" }
              }
            }
          },
          "481": {
            "description": "UnauthorizedException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/UnauthorizedException"
                }
              }
            }
          },
          "482": {
            "description": "NotFoundException",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/NotFoundException" }
              }
            }
          },
          "483": {
            "description": "InternalFailureException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/InternalFailureException"
                }
              }
            }
          },
          "484": {
            "description": "LimitExceededException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/LimitExceededException"
                }
              }
            }
          },
          "485": {
            "description": "DependentServiceFailureException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/DependentServiceFailureException"
                }
              }
            }
          }
        },
        "parameters": [
          {
            "name": "appId",
            "in": "path",
            "required": true,
            "description": " The unique ID for an Amplify app. ",
            "schema": {
              "type": "string",
              "minLength": 1,
              "maxLength": 255,
              "pattern": "d[a-z0-9]+"
            }
          }
        ],
        "requestBody": {
          "required": true,
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "required": ["branchName"],
                "properties": {
                  "branchName": {
                    "description": " The name for the branch. ",
                    "type": "string",
                    "minLength": 1,
                    "maxLength": 255
                  },
                  "description": {
                    "description": " The description for the branch. ",
                    "type": "string",
                    "maxLength": 1000
                  },
                  "stage": {
                    "description": " Describes the current stage for the branch. ",
                    "type": "string",
                    "enum": [
                      "PRODUCTION",
                      "BETA",
                      "DEVELOPMENT",
                      "EXPERIMENTAL",
                      "PULL_REQUEST"
                    ]
                  },
                  "framework": {
                    "description": " The framework for the branch. ",
                    "type": "string",
                    "maxLength": 255
                  },
                  "enableNotification": {
                    "description": " Enables notifications for the branch. ",
                    "type": "boolean"
                  },
                  "enableAutoBuild": {
                    "description": " Enables auto building for the branch. ",
                    "type": "boolean"
                  },
                  "environmentVariables": {
                    "description": " The environment variables for the branch. ",
                    "type": "object",
                    "additionalProperties": {
                      "$ref": "#/components/schemas/EnvValue"
                    }
                  },
                  "basicAuthCredentials": {
                    "description": " The basic authorization credentials for the branch. ",
                    "type": "string",
                    "maxLength": 2000,
                    "format": "password"
                  },
                  "enableBasicAuth": {
                    "description": " Enables basic authorization for the branch. ",
                    "type": "boolean"
                  },
                  "tags": {
                    "description": " The tag for the branch. ",
                    "type": "object",
                    "minProperties": 1,
                    "maxProperties": 50,
                    "additionalProperties": {
                      "$ref": "#/components/schemas/TagValue"
                    }
                  },
                  "buildSpec": {
                    "description": " The build specification (build spec) file for an Amplify app build. ",
                    "type": "string",
                    "minLength": 1,
                    "maxLength": 25000
                  },
                  "ttl": {
                    "description": " The content Time to Live (TTL) for the website in seconds. ",
                    "type": "string"
                  },
                  "displayName": {
                    "description": " The display name for a branch. This is used as the default domain prefix. ",
                    "type": "string",
                    "maxLength": 255
                  },
                  "enablePullRequestPreview": {
                    "description": " Enables pull request preview for this branch. ",
                    "type": "boolean"
                  },
                  "pullRequestEnvironmentName": {
                    "description": " The Amplify environment name for the pull request. ",
                    "type": "string",
                    "maxLength": 20
